FIM_acc <- function(value)
{
	if (!isnull(.self$.cobj)) {
		if (missing(value)) {
			so_MLE_get_FIM(.self$.cobj)
		} else {
			if (!is(value, "matrix")) {
				stop("object must be of type 'matrix'")
			}
			so_MLE_set_FIM(.self$.cobj, value)
		}
	}
}

