so_MLE = setRefClass("so_MLE",
	fields=list(
		FIM = FIM_acc,
		CovarianceMatrix = CovarianceMatrix_acc,
		CorrelationMatrix = CorrelationMatrix_acc,
		StandardError = StandardError_acc,
