		AsymptoticCI = AsymptoticCI_acc,
		ConditionNumber = ConditionNumber_acc,
		.cobj = "externalptr"
	),
	methods=list(
		copy = function() {
			copy = so_MLE_copy(.self$.cobj)
			so_MLE$new(cobj=copy)
		},
		initialize = function(cobj) {
			if (missing(cobj)) {
				.cobj <<- so_MLE_new()
			} else {
				.cobj <<- cobj
			}
		},
		finalize = function() {
			so_MLE_unref(.self$.cobj)
